        const jwt = authComponents.get("accessToken");

        // Make sure the JWT got populated
        pm.expect(jwt).to.not.have.length(0);

        // Separate out the components of the JWT (JWT is in format of "<header>.<payload>.<signature>")
        const jwtComponents = jwt.split(".");

        // Get the payload component of the JWT (the middle component)
        const jwtPayload = jwtComponents[1];

        // Decode the JWT payload from base 64 string
        const decodedJWTPayload = atob(jwtPayload);

        // Parse the JWT payload into JSON
        const jwtPayloadJSON = JSON.parse(decodedJWTPayload);

        // Grab the "sub" from the JWT payload JSON
        const sub = jwtPayloadJSON["sub"];

        // Save the "sub" to the Postman environment as the Azure B2C Object ID
        pm.environment.set("azureB2cObjectId", sub);
